import { Component } from '@angular/core';
import { Http, Headers, RequestOptions } from '@angular/http';
import { NavController, LoadingController, AlertController } from 'ionic-angular';
import { Camera, CameraOptions } from '@ionic-native/camera';

import { Page1Page } from '../page1/page1';
import { PortoSeguroAuto2Page } from '../porto-seguro-auto2/porto-seguro-auto2';

import 'rxjs/add/operator/map';

@Component({
  selector: 'page-porto-seguro-auto',
  templateUrl: 'porto-seguro-auto.html'
})
export class PortoSeguroAutoPage {
  	
	public imageDataRequest : string;
	public foto : string;
	public photos : any;
	public base64Image : string;
	public resultadoJson;

	constructor(public navCtrl: NavController, public loadingController : LoadingController, private camera : Camera, private alertCtrl : AlertController, public http: Http) {}

	ngOnInit() {
    this.foto = 'assets/img/camera.png';
    	this.photos = [];
  	}


	postRequest() {
		let loading = this.loadingController.create();

		if (this.imageDataRequest != undefined && this.imageDataRequest != '') {
			loading.present();
			this.getVistoria()
				.then((result: any) => {

					console.log('result.cor: ' + result.cor) ;
					this.resultadoJson = result;
					console.log('resultadoJson: ', result);

					this.navCtrl.push(PortoSeguroAuto2Page, {resultadoJson: this.resultadoJson});

					loading.dismissAll();
				})
				.catch((error: any) => {
					loading.dismissAll();
				let confirm = this.alertCtrl
				.create({
					title: 'Atenção',
					message: 'Imagem não identificada como veículo!',
					buttons: ['OK']
				});

			confirm.present();
					//this.toast.create({ message: 'Erro ao recuperar o usuário. Erro: ' + error.error, position: 'botton', duration: 3000 }).present();
				});
		} else {
			let confirm = this.alertCtrl
				.create({
					title: 'Atenção',
					message: 'Obrigatório tirar foto do veículo.',
					buttons: ['OK']
				});

			confirm.present();
		}
	}

	getTeste() {
		return new Promise((resolve, reject) => {

		  this.http.get('assets/response.json')
			.subscribe((result: any) => {
			  resolve(result.json());
			},
			(error) => {
			  reject(error.json());
			});
		});
	}

  getVistoria() {
    
    let headers = new Headers();
    headers.append('Content-Type', 'application/x-www-form-urlencoded' );
  	headers.append('Accept', 'application/json');
  	headers.append('Access-Control-Allow-Origin', '*');
    
    let options = new RequestOptions({ headers: headers });
    
    /*let postParams = {
      filename: 'celta-lat-dir.jpg',
      url: '',
      imagemB64: this.imageDataRequest
      
    }*/
	  let postParams = {
      url: '',
      imagemB64: this.imageDataRequest
    }
    //imagemB64: ''    
    
    return new Promise((resolve, reject) => {
    
	//this.http.post("http://104.154.193.29/poc.sinistro/cars", postParams, options)
	this.http.post("http://172.16.92.246", postParams, options)
		.subscribe((result: any) => {
			resolve(result.json());
        },
        (error) => {
			reject(error.json());
        });
    });
  }

  deletePhoto() {
	let alert = this
      .alertCtrl
      .create({
        title: '',
        message: 'Realmente deseja excluir a Imagem?',
        buttons: [
          {
            text: 'Não',
			role: 'cancel',
            handler: () => {
              console.log('Disagree clicked');
            }
          }, {
            text: 'Sim',
            handler: () => {
              console.log('Agree clicked');
              this.foto = 'assets/img/camera.png';
			  this.imageDataRequest = '';
              //return true;
            }
          }
        ]
      });
	  
	  alert.present();
  }

	accessGalery() {
		this.camera.getPicture({
			sourceType: this.camera.PictureSourceType.SAVEDPHOTOALBUM,
			destinationType: this.camera.DestinationType.DATA_URL
		}).then((imageData) => {
			this.base64Image = 'data:image/jpeg;base64,' + imageData;
			this.imageDataRequest = imageData;
			this.foto = this.base64Image;
		}, (err) => {
			console.log(err);
		});
	}

	takePhoto() {
		const options : CameraOptions = {
			quality: 70,
			destinationType: this.camera.DestinationType.DATA_URL,
			encodingType: this.camera.EncodingType.JPEG,
			mediaType: this.camera.MediaType.PICTURE
		}
		this.camera
			.getPicture(options)
			.then((imageData) => {
		
				this.base64Image = "data:image/jpeg;base64," + imageData;
				this.imageDataRequest = imageData;
				this.foto = this.base64Image;
			}, (err) => {
				console.log(err);
			});
		}

  goToPortoSeguroAuto2(params){
	  this.getTeste()
				.then((result: any) => {

					
					this.resultadoJson = result;
					console.log('resultadoJson: ', result);

					this.navCtrl.push(PortoSeguroAuto2Page, {resultadoJson: this.resultadoJson});

					//loading.dismissAll();
				})
				.catch((error: any) => {
					//this.toast.create({ message: 'Erro ao recuperar o usuário. Erro: ' + error.error, position: 'botton', duration: 3000 }).present();
				});
    if (!params) params = {};
    this.navCtrl.push(PortoSeguroAuto2Page, {resultadoJson: this.resultadoJson});
  } 

  goToPortoSeguroAuto(params){
    if (!params) params = {};
    this.navCtrl.push(PortoSeguroAutoPage);
  }

  goToPage1(params){
    if (!params) params = {};
    this.navCtrl.push(Page1Page);
  }
}
